import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route,Routes } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path='/friends' element={<div className='App'>Hello</div>}></Route>
    </Routes>
  );
}

export default App;
